INSERT INTO `odj_company` (`id`, `city_id`, `image_id`, `name`, `site`, `phone`, `description`) VALUES
(2, 2964, 12, 'Dell Ink', 'http://www.dell.com/', '+74951234567', 'Dell — американская корпорация, одна из крупнейших компаний в области производства компьютеров. Входит в список Fortune 1000 по итогам 2005 года. Штаб-квартира находится в Раунд-Роке в штате Техас в США.'),
(3, 2964, 4, 'Lenovo Group Limited', 'http://www.lenovo.com/', '1-800-854-3680', 'Lenovo Group Limited — китайская компьютерная компания. Зарегистрирована в Сингапуре. Штаб-квартира компании Lenovo расположена в Перчейзе, а основные операционные офисы — в Пекине и Рейли.'),
(4, 2964, 5, 'Sharp Corporation', 'http://www.sharp.com/', '1-800-854-3680', 'Sharp Corporation — японская корпорация, производитель электроники.'),
(5, 2964, 6, 'Microsoft Corporation', 'https://www.microsoft.com', '01932 455 000', 'Microsoft Corporation — одна из крупнейших транснациональных компаний по производству проприетарного программного обеспечения для различного рода вычислительной техники — персональных компьютеров, игровых приставок, КПК, мобильных телефонов и прочего, разработчик наиболее широко распространённой на данный момент в мире программной платформы[4] — семейства операционных систем Windows.');
