(3, 2, 230, 2964, 2, 2, 'Менеджер по персоналу', 1, 3, 4, 'Подбор среднего и высшего звена, линейного персонала Проведение и анализ собеседований Согласование сроков прохождения собеседований Адаптация и мотивация персонала Работа со СМИ Мониторинг рынка труда Ведение отчетности по набору персонала Частичное КДП Участие..', 'Уверенный пользователь ПК; Знание различных технологий поиска и оценки персонала; Активность, высокая работоспособность, ответственность Опыт работы в подборе от 1 года', 5000, 500, 'rub', '2015-05-13 13:46:11', '2015-07-23 00:00:00', NULL, '2015-10-21 00:00:00', 80, 'Уверенный пользователь ПК; Знание различных технологий поиска и оценки персонала; Активность, высокая работоспособность, ответственность Опыт работы в подборе от 1 года', 0, 0),
(5, 2, 230, 2964, 8, 191, 'Дизайнер', 1, 4, 2, 'Разработка концепции, креативный дизайн, верстка рекламных материалов (каталоги, буклеты, проспекты и т.д.) дизайн рекламно-сувенирной продукции; цветокоррекция; разработка баннеров; обработка фото для рекламы; поддержание фирменного стиля; prepress; web-дизайн', 'Опыт работы в сегменте Luxury или в глянцевых журналах от 3 лет; знание ПК, графических программных пакетов Adobe (Protoshop, InDesign, Illustrator), Acrobat Reader, Corel Drew; знание академических основ композиции; опыт регулярного дизайна и верстки брошюр', 1000, 100, 'usd', '2015-05-13 13:50:16', '2015-06-08 00:00:00', '2015-06-02 00:00:00', '2015-08-29 00:00:00', 145, 'Уверенный пользователь ПК; Знание различных технологий поиска и оценки персонала; Активность, высокая работоспособность, ответственность Опыт работы в подборе от 1 года', 0, 0);
